import './About.css';
import {AboutImage} from '../../images/AboutImage.jpeg';



const About = () =>{
    return(

      <section id="About">
        <div className='AboutHeader'>
          <span className='AboutHeader_h1'>About Me</span>
        </div>
        <div className='AboutImageMain'>
          <img src={AboutImage} className='AboutImage' />
        </div>
        <div className='AboutContentMain'>
          <spam>I am Software Developer</spam>
        </div>
      </section>

    )
}
export default About;
